// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract NFTMarketplace is ReentrancyGuard {
    uint256 public _nftsSold = 0;
    uint256 public _nftCount = 0;
    uint256 public LISTING_FEE = 0.0001 ether;
    address payable private _marketOwner;
    mapping(uint256 => Token) private _idToToken;

    //"https://ipfs.io/ipfs/QmSHyHr3kHKza3YRMfNz5HFatotSvLSa17YHJPzXJow1gU",
    //"https://ipfs.io/ipfs/QmVqKAMsQRbNcVffMUwyzVHhcx37sx46qnFX6nnYqu1rb9",
    //"https://ipfs.io/ipfs/QmcEd1R1Qq7M6G7NnHxDXYdiYtJAn9A2FGjg94Ku75HgUD",
    //"https://ipfs.io/ipfs/QmUveY3PgfLD9TahrAEH2WieCG1PfU9Ybdq9WbZe8wXwvQ",
    //"https://ipfs.io/ipfs/QmNeo34iQGsPLagnw1E6LjzfgmqVNLYftCymHKv11q9QsS",
    //"https://ipfs.io/ipfs/QmXou1mty7AqhKzxrxC5C7Xqx8yVjVi8ZEqjacUpQQ89hD",

    struct Token {
        address nftContract;
        uint256 tokenId;
        address payable seller;
        address payable owner;
        string tokenURI;
        string name;
        uint256 price;
        bool isListed;
    }

    event NFTListed(
        address nftContract,
        uint256 tokenId,
        address seller,
        address owner,
        uint256 price
    );
    event NFTSold(
        address nftContract,
        uint256 tokenId,
        address seller,
        address owner,
        uint256 price
    );

    constructor() {
        _marketOwner = payable(msg.sender);
    }

    // List the NFT on the marketplace
    function listNFT(
        address nftContract,
        uint256 tokenId,
        string memory _name,
        string memory _tokenURI
    ) public payable nonReentrant {
        require(msg.value > 0, "Price must be at least 0.0001 ether.");
        require(
            msg.value == LISTING_FEE,
            "not enough ether for the listing fee."
        );

        IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

        ++_nftCount;

        _idToToken[tokenId] = Token(
            nftContract,
            tokenId,
            payable(msg.sender),
            payable(address(this)),
            _tokenURI,
            _name,
            LISTING_FEE,
            true
        );

        emit NFTListed(
            nftContract,
            tokenId,
            msg.sender,
            address(this),
            LISTING_FEE
        );
    }

    // Buy an NFT
    function buyNFT(
        address nftContract,
        uint256 tokenId
    ) public payable nonReentrant {
        address owner = IERC721(nftContract).ownerOf(tokenId);
        Token storage nft = _idToToken[tokenId];

        require(
            msg.value >= nft.price,
            "Not enough ether to cover the token price"
        );

        address buyer = payable(msg.sender);
        payable(nft.seller).transfer(msg.value);
        IERC721(nftContract).setApprovalForAll(buyer, true);
        IERC721(nftContract).approve(buyer, tokenId);
        IERC721(nftContract).transferFrom(owner, buyer, nft.tokenId);

        _marketOwner.transfer(LISTING_FEE);
        nft.owner = payable(buyer);
        nft.isListed = false;

        ++_nftsSold;

        emit NFTSold(nftContract, nft.tokenId, nft.seller, buyer, msg.value);
    }

    // Resell an NFT purchased from the marketplace
    function resellNFT(
        address nftContract,
        uint256 tokenId
    ) public payable nonReentrant {
        address owner = IERC721(nftContract).ownerOf(tokenId);
        Token storage nft = _idToToken[tokenId];

        IERC721(nftContract).transferFrom(owner, address(this), nft.tokenId);
        nft.seller = payable(msg.sender);
        nft.owner = payable(address(this));
        nft.isListed = true;

        --_nftsSold;

        emit NFTListed(
            nftContract,
            tokenId,
            msg.sender,
            address(this),
            LISTING_FEE
        );
    }
